                .then(results => {
                    directs.innerHTML = ''
                    for (result in results) {
                        directs.innerHTML += `<option value=""${results[result].value}""> ${results[result].text} </option>`
                    }
                    updateSubDirects()
                })
        }

        // listen to changes
        govers.addEventListener('change', () => {
            updateDirects()
        })

        directs.addEventListener('change', () => {
            updateSubDirects()
        })
    </script>


